import { Switch,Route } from "react-router-dom"
import LoginForm from "./LoginForm"

import loginImg from '../../'

export default function Login() {
    return (
        <main>
            <img src={loginImg} alt="" />
            <Switch>
                <Route path="/" component={LoginForm} />
            </Switch>
        </main>
    )
}
